import { createStore } from 'vuex'

export default createStore({
    state: {
        donnees: {},
    },
    getters: {
        get_donnees(state) {
            return state.donnees
        },
    },
    mutations: {
        set_donnees(state, donnees) {
            state.donnees = donnees
        }
    },
    actions: {
        set_donnees({ commit }, donnees) {
            commit('set_donnees', donnees)
        }
    },
    modules: {}
})
